import axios from 'axios'

require('dotenv').config()

const {
  REACT_APP_PROJECT_ENDPOINT
} = process.env

const api = axios.create({
  baseURL: `${REACT_APP_PROJECT_ENDPOINT}/api/v1/`
})

export default api
